import {combineReducers } from 'redux';
import loginReducer from './loginReducer';
import manageCustomerReducer from './manageCustomerReducer';
import manageCommissionRateReducer from './manageCommissionRateReducer';
import manageRequirementsReducer from './manageRequirementsReducer';
import manageDeliveryBoyReducer from './manageDeliveryBoyReducer';

const rootReducer = combineReducers({
    loginReducer,
    manageCustomerReducer,
    manageCommissionRateReducer,
    manageRequirementsReducer,
    manageDeliveryBoyReducer
    })

export default rootReducer;
